Alternating (stop/slow) traffic conditions will be in place. Motorists are advised to allow around five minutes extra travel time. <br><br>Lane width restrictions will be in
place -&nbsp;<strong>3.2m</strong> lanes and <strong>0.5m</strong> road shoulders in both directions. Vehicles over
<strong>4.0m</strong> wide should use the wide load bay.&nbsp;

Site compounds will be established at the south eastern and northern ends of the bridge. <br>Work involves completely enclosing each span of the
bridge to remove and dispose of the existing paint before applying new paint.&nbsp; 

&nbsp;
<br>Maintenance work will start from Thursday 11 June. 

&nbsp;
<br>Temporary lane closures will
be in place during work hours for the safety of workers and motorists, which
may affect travel times.
